        \"Downloading SSH key\"\n\nssh_key=$(curl --request GET \\\n  --url \"${CODER_AGENT_URL}api/v2/workspaceagents/me/gitsshkey\"
        \\\n  --header \"Coder-Session-Token: ${CODER_AGENT_TOKEN}\" \\\n  --silent
        --show-error)\n\njq --raw-output \".public_key\" \u003e ~/.ssh/git-commit-signing/coder.pub
        \u003c\u003c EOF\n$ssh_key\nEOF\n\njq --raw-output \".private_key\" \u003e
        ~/.ssh/git-commit-signing/coder \u003c\u003c EOF\n$ssh_key\nEOF\n\nchmod -R
        600 ~/.ssh/git-commit-signing/coder\nchmod -R 644 ~/.ssh/git-commit-signing/coder.pub\n\necho
        \"Configuring git to use the SSH key\"\n\ngit config --global gpg.format ssh\ngit
